import React from 'react';

const ContactCard = () => {
  const contactInfo = {
    name: "Jane Smith",
    title: "Senior Software Engineer",
    email: "jane.smith@example.com",
    phone: "+1 (555) 123-4567",
    location: "San Francisco, CA",
    website: "www.janesmith.dev",
    linkedin: "linkedin.com/in/janesmith",
    github: "github.com/janesmith"
  };

  return (
    <div className="max-w-md w-full bg-white rounded-lg shadow-lg overflow-hidden">
      {/* Header Section */}
      <div className="p-6 space-y-1">
        <h2 className="text-2xl font-bold text-gray-800">{contactInfo.name}</h2>
        <p className="text-gray-500">{contactInfo.title}</p>
      </div>

      {/* Contact Information */}
      <div className="p-6 space-y-4">
        <div className="space-y-3">
          {/* Email */}
          <div className="flex items-center space-x-3">
            <span className="text-blue-500 font-bold">‚úâ</span>
            <a href={`mailto:${contactInfo.email}`} 
               className="text-blue-600 hover:underline">
              {contactInfo.email}
            </a>
          </div>

          {/* Phone */}
          <div className="flex items-center space-x-3">
            <span className="text-green-500 font-bold">üìû</span>
            <a href={`tel:${contactInfo.phone}`} 
               className="hover:text-gray-600">
              {contactInfo.phone}
            </a>
          </div>

          {/* Location */}
          <div className="flex items-center space-x-3">
            <span className="text-red-500 font-bold">üìç</span>
            <span>{contactInfo.location}</span>
          </div>

          {/* Social Links */}
          <div className="pt-4 mt-2 border-t border-gray-200">
            {/* Website */}
            <div className="flex items-center space-x-3 mb-2">
              <span className="text-purple-500 font-bold">üåê</span>
              <a href={`https://${contactInfo.website}`} 
                 className="text-blue-600 hover:underline"
                 target="_blank" 
                 rel="noopener noreferrer">
                {contactInfo.website}
              </a>
            </div>

            {/* LinkedIn */}
            <div className="flex items-center space-x-3 mb-2">
              <span className="text-blue-600 font-bold">in</span>
              <a href={`https://${contactInfo.linkedin}`} 
                 className="text-blue-600 hover:underline"
                 target="_blank" 
                 rel="noopener noreferrer">
                {contactInfo.linkedin}
              </a>
            </div>

            {/* GitHub */}
            <div className="flex items-center space-x-3">
              <span className="text-gray-700 font-bold">GH</span>
              <a href={`https://${contactInfo.github}`} 
                 className="text-blue-600 hover:underline"
                 target="_blank" 
                 rel="noopener noreferrer">
                {contactInfo.github}
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactCard;
